			using Skyline.DataMiner.Scripting;
using Skyline.Protocol.Model;
using System;
using System.Globalization;
using System.Linq;
using System.Threading;

/// <summary>
/// QAction to generate data.
/// </summary>
public class QAction
{
    public bool UpdateAfterFailure(SLProtocolExt protocol)
    {
        DateTime startTime;
        int lastRow;
        var started = protocol.Afterfailurestarted as string;
        if (started == "No")
        {
            protocol.Log(8, 5, "Pushing initial data (after failure)");
            startTime = DateTime.Now - Data.START_TIME_TIME_AGO;
            lastRow = -1;
            protocol.Afterfailurestarttime = startTime;
            protocol.Afterfailurestarted = "Yes";
        }
        else
        {
            startTime = DateTime.FromOADate(Convert.ToDouble(protocol.Afterfailurestarttime));
            lastRow = int.Parse(protocol.Afterfailurelastrownumber.ToString(), CultureInfo.InvariantCulture);
        }

        var data = Data.GetDataWithFailure();
        int maxValuesPerTime = Data.FastVersion ? 10000 : 5;

        int valuesPushed = 0;
        for (int j = lastRow + 1; j < lastRow + maxValuesPerTime + 1; j++)
        {
            var (time, value) = data.GetValue(startTime, j);
            if (time >= DateTime.Now)
                break;

            protocol.SetParameter(Parameter.cacheutilizationafterfailure, value, time);
            ++valuesPushed;
        }

        protocol.Afterfailurelastrownumber = lastRow + valuesPushed;
        return valuesPushed < maxValuesPerTime;
    }

    public bool UpdateBeforeFailure(SLProtocolExt protocol)
    {
        var shouldStart = protocol.Beforefailureshouldstart as string;
        if (shouldStart == "No")
            return true;

        DateTime startTime;
        int lastRow;
        var started = protocol.Beforefailurestarted as string;
        if (started == "No")
        {
            protocol.Log(8, 5, "Pushing initial data (before failure)");
            startTime = DateTime.Now - Data.START_TIME_TIME_AGO;
            lastRow = -1;
            protocol.Beforefailurestarttime = startTime;
            protocol.Beforefailurestarted = "Yes";
        }
        else
        {
            startTime = DateTime.FromOADate(Convert.ToDouble(protocol.Beforefailurestarttime));
            lastRow = int.Parse(protocol.Beforefailurelastrownumber.ToString(), CultureInfo.InvariantCulture);
        }

        var data = Data.GetDataWithoutFailure();
        int maxValuesPerTime = Data.FastVersion ? 10000 : 200;

        int valuesPushed = 0;
        for (int j = lastRow + 1; j < lastRow + maxValuesPerTime + 1; j++)
        {
            var (time, value) = data.GetValue(startTime, j);
            if (time >= DateTime.Now)
                break;

            protocol.SetParameter(Parameter.cacheutilizationbeforefailure, value, time);
			Thread.Sleep(100);
            ++valuesPushed;
        }

        protocol.Beforefailurelastrownumber = lastRow + valuesPushed;
        return valuesPushed < maxValuesPerTime;
    }

    /// <summary>
    /// The QAction entry point.
    /// </summary>
    /// <param name="protocol">Link with SLProtocol process.</param>
    public void Run(SLProtocolExt protocol)
	{
        protocol.Log(8, 5, "Generating history data");
        protocol.Datagenerated = "Generating history...";

        bool historyGenerated = UpdateAfterFailure(protocol);
        historyGenerated &= UpdateBeforeFailure(protocol);

        if (historyGenerated)
            protocol.Datagenerated = "History generated";
        else
            protocol.Datagenerated = "Waiting to generate more history";
    }
}
